// App.js
import React from 'react';
import './App.css';
import Home from './Home';
import Pred from './PricePredictions';
import GenPred from './GeneratedPredictions';
import { Routes, Route } from 'react-router-dom';
import NavBar from './NavBar';
import Footer from './Footer';

function App() {
    return (
        <div className="App">
            <NavBar />
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/PricePredictions" element={<Pred />} />
                <Route path="/GeneratedPredictions" element={<GenPred />} />
                {/* Add other routes like Market Analysis here */}
            </Routes>
            <Footer />
        </div>
    );
}

export default App;
